function createFormValidator(
    ruleConfigs: ruleConfigType[]
): (
    dataSource: { [key: string]: any },
    validateFields?: Array
) => {
    result: boolean
    message: string
}

Usage
pass
createFormValidator([
    {
        fieldname: 'name',
        rules: [
            {
                name: 'required',
                rule: true,
                message: 'required error'
            },
            {
                name: 'maxLen',
                rule: 3,
                message: 'maxLen error'
            },
            {
                name: 'minLen',
                rule: 2,
                message: 'minLen error'
            },
            {
                name: 'validator',
                rule(value) {
                    return value === '123'
